import React, { useState, useRef, useCallback } from "react";
import ReactSwipe from 'react-swipe';
import { Room } from "../generated/graphql";
import '../assets/scss/room.scss';
type Props = {
    room: Room
};

const RoomdetailPicture: React.FunctionComponent<Props> = ({
    room
}) => {
    let carouselRef: any = useRef();
    return (
        <div className="roomdetail-container3">
            <ReactSwipe
                className="carousel"
                swipeOptions={{ continuous: true }}
                ref={el => (carouselRef = el)}
            >
                <div style={ { width: '100%', height: '100%', backgroundImage: 'url("http://blogfiles.naver.net/MjAxNzA3MjRfMjMy/MDAxNTAwODg0ODk3MTEz.KqTIMMFDmvvkmhmIKi-DM50TrpHdAT_tkuE_Csj2kBUg.qnUks8R6OqabUt7bPtyXHEnWhCtyn2P3zSV562xzEqMg.JPEG.ez2dj1298/0000212499_001_20170723163328787.jpg")' } }>야야야</div>
                <div style={ { width: '100%', height: '100%', backgroundImage: 'url("http://blogfiles.naver.net/MjAxOTA3MDZfMTE3/MDAxNTYyMzU3NzQ1MzU5.as2grkmNrdtTS0mjbHA65mNwueYU0J58jit8-7v0vFMg.cSv_1Gl01v_UV5gNEY7eN0ts8YwnmX5THJgPP-7a0QIg.JPEG.audtnrhfo/1562353665384.jpg")' } }>야야야2</div>
            </ReactSwipe>
            <button onClick={() => carouselRef.next()}>Next</button>
            <button onClick={() => carouselRef.prev()}>Previous</button>
        </div>
    );
}

export default RoomdetailPicture;
